import * as React from 'react';

import Steps from '../steps/';

const myLifeCompass = {
  my_vision: {
    vision:''
  },
  my_purpose: {
    reason1: '',
    reason2: '',
    reason3: ''
  },
  my_values: {
    value1: '',
    value2: '',
    value3: '',
    value4: '',
    value5: ''
  }
}

const handleInput = (event) => {
  console.log(event);
};

const App = () => {
  return (
    <div className="App">
      <div className="App-header">
        <Steps data={myLifeCompass} onInput={handleInput}/>
      </div>
    </div>
  );
}

export default App;
